import AccountNavbar from "../../../components/account/AccountNavbar/AccountNavbar";

import AccountSidebar from "../../../components/account/AccountSidebar/AccountSidebar";

import User from "../../../assets/icons/user.png";

import { useState } from "react";

import ".././Clients.css";

import "./Profile.css";

import UploadIcon from "../../../assets/icons/upload (1).png";

import UpdateDescription from "./UpdateDescription";

import UpdateName from "./UpdateName";

import UpdateEmail from "./UpdateEmail";

import UpdatePhone from "./UpdatePhone";

const Profile = () => {
  const [sidebar, showSidebar] = useState(false);

  const handleShowSidebar = () => {
    showSidebar(!sidebar);
  };

  return (
    <div className="account profile">
      <AccountNavbar
        sidebar={sidebar}
        handleShowSidebar={handleShowSidebar}
        title="PROFILE"
      />
      <AccountSidebar sidebar={sidebar} />
      <p className="empty"></p>

      <div className="container">
        <div className="profile-container">
          <div className="col">
            <div className="image-wrapper">
              <img src={User} alt="" />
            </div>
            <div className="upload">
              <img src={UploadIcon} alt="" className="uploadIcon" />
              <input type="submit" value="SAVE" className="submit-btn" />
            </div>
            <div className="profile-details">
              <div className="row">
                <p>Name</p>
                <p>Alexander GrahamBell</p>
              </div>
              <div className="row">
                <p>Email</p>
                <p>rahambell@gmail.com</p>
              </div>
              <div className="row">
                <p>Phone</p>
                <p>06752374523523</p>
              </div>
              <div className="row">
                <p>Course</p>
                <p>Barchelor of science(Statistics)</p>
              </div>
              <div className="description">
                My commitment to delivering high-quality work, coupled with my
                ability to communicate effectively and understand client needs,
                makes me a valuable asset for any writing project. I am always
                eager to take on new challenges and help clients achieve their
                goals through impactful and engaging content.
              </div>
            </div>
          </div>
          <div className="col">
            <UpdateDescription />
            <UpdateName />
            <UpdateEmail />
            <UpdatePhone />

          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
